webpackJsonp([0x715d458b8548],{424:function(e,t){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Скамья Скотта заставляет мышцы бицепсов работать изолированно и позволяет достичь максимальной нагрузки. Опускать штангу вниз необходимо как можно медленней, чтобы избежать риск получения травмы локтя. Упражнение обычно выполняют с штангой с EZ-грифом (можно использовать гантели).</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Сядьте на скамью Скотта, возьмите штангу. Плотно обопритесь грудью и локтями в подставку.</li>\n<li>Исходное положение – руки согнуты в локтях, ладони находятся на уровне плеч и направлены вперед.</li>\n<li>На вдохе – медленно опускайте штангу, выпрямляя руки.</li>\n<li> На выдохе, за счет напряжения бицепсов, сгибайте руки до полного сокращения бицепсов, при этом штанга должна оказаться на уровне плеч. Ненадолго задержитесь в верхней точке.</li>\n<li>Выполните необходимое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/yeUujQ-kERg" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/podjem-shtangi-na-biceps-na-skamje-skotta",efficiency:"9",title:"Подъем штанги на бицепс на скамье Скотта",image:"/static/3-01-0.jpg",image_2:"",image_3:"",image_4:"",filterby:"biceps",date:"April 12, 2017",injury:"4",bodypart:"Бицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"stange",inventory:"Штанга",filterplace:"scott"}}},pathContext:{}}}});
